import React from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

const IconSpinner = () => (
  <span>
    <FontAwesomeIcon icon="spinner" spin />
  </span>
);
const IconPositive = () => (
  <span>
    <FontAwesomeIcon icon="sad-tear" pulse />
  </span>
);
const IconRecovery = () => (
  <span>
    <FontAwesomeIcon icon="grin-alt" spin />
  </span>
);
const IconDeath = () => (
  <span>
    <FontAwesomeIcon icon="dizzy" spin />
  </span>
);

export default { IconSpinner, IconPositive, IconRecovery, IconDeath };
